-- Table structure for table `tickets`
--

DROP TABLE IF EXISTS `tickets`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tickets` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `opener_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `customer` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `building` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `refnum` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `title` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `ticketsubject` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `ticket_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `ticket_to` longtext COLLATE utf8mb4_unicode_ci,
  `delete` int NOT NULL DEFAULT '0',
  `assigned_type` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `closing_comment` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `assined_persons` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `evaluator_persons` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `closing_date` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=173 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
